// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title OrthoConsent
 * @dev Gestin avanzada de consentimiento informado para datos mdicos
 */
contract OrthoConsent is Ownable {
    // Tipos de propsito para el consentimiento
    enum Purpose {
        DIAGNOSIS, // Diagnstico directo
        SECOND_OPINION, // Segunda opinin
        RESEARCH, // Investigacin acadmica
        AI_TRAINING, // Entrenamiento de IA
        COMMERCIAL // Uso comercial
    }

    struct Consent {
        uint256 tokenId; // ID del NFT mdico
        address patient; // Dueo de los datos
        address recipient; // Quin recibe el acceso (mdico/investigador)
        Purpose purpose; // Para qu se usa
        uint256 startTime; // Cundo inicia
        uint256 expirationTime; // Cundo expira
        bool isValid; // Si est activo o revocado
        string termsHash; // Hash IPFS de los trminos legales firmados (PDF/Texto)
    }

    // Mappings
    // Hash del consentimiento (keccak256) -> Estructura Consent
    mapping(bytes32 => Consent) public consents;

    // Usuario -> Lista de hashes de sus consentimientos
    mapping(address => bytes32[]) public userConsents;

    // Eventos para auditora
    event ConsentGranted(
        bytes32 indexed consentId,
        address indexed patient,
        address indexed recipient,
        uint256 tokenId,
        Purpose purpose,
        uint256 expirationTime
    );

    event ConsentRevoked(
        bytes32 indexed consentId,
        address indexed patient,
        address indexed recipient,
        string reason
    );

    constructor() {}

    /**
     * @dev Otorgar un consentimiento informado
     * @param _tokenId ID del NFT mdico
     * @param _recipient Direccin del mdico/investigador
     * @param _purpose Propsito del uso
     * @param _durationSeconds Duracin en segundos (0 = indefinido)
     * @param _termsHash Hash IPFS del documento de trminos (opcional)
     */
    function grantConsent(
        uint256 _tokenId,
        address _recipient,
        Purpose _purpose,
        uint256 _durationSeconds,
        string memory _termsHash
    ) public returns (bytes32) {
        require(_recipient != address(0), "Invalid recipient");
        require(_recipient != msg.sender, "Cannot grant to self");

        // Calcular fecha de expiracin
        uint256 expiration = 0;
        if (_durationSeconds > 0) {
            expiration = block.timestamp + _durationSeconds;
        }

        // Generar ID nico para este consentimiento
        bytes32 consentId = keccak256(
            abi.encodePacked(
                msg.sender,
                _recipient,
                _tokenId,
                _purpose,
                block.timestamp
            )
        );

        // Crear registro
        consents[consentId] = Consent({
            tokenId: _tokenId,
            patient: msg.sender,
            recipient: _recipient,
            purpose: _purpose,
            startTime: block.timestamp,
            expirationTime: expiration,
            isValid: true,
            termsHash: _termsHash
        });

        // Guardar referencia para el usuario
        userConsents[msg.sender].push(consentId);

        emit ConsentGranted(
            consentId,
            msg.sender,
            _recipient,
            _tokenId,
            _purpose,
            expiration
        );

        return consentId;
    }

    /**
     * @dev Revocar un consentimiento existente
     */
    function revokeConsent(bytes32 _consentId, string memory _reason) public {
        Consent storage consent = consents[_consentId];

        require(consent.patient == msg.sender, "Not the patient");
        require(consent.isValid, "Consent already revoked or invalid");

        consent.isValid = false;

        emit ConsentRevoked(_consentId, msg.sender, consent.recipient, _reason);
    }

    /**
     * @dev Verificar si existe un consentimiento vlido
     */
    function checkConsent(
        address _patient,
        address _recipient,
        uint256 _tokenId,
        Purpose _purpose
    ) public view returns (bool) {
        // Recorrer los consentimientos del paciente (esto podra optimizarse off-chain)
        bytes32[] memory patientConsents = userConsents[_patient];

        for (uint i = 0; i < patientConsents.length; i++) {
            Consent memory c = consents[patientConsents[i]];

            if (
                c.isValid &&
                c.recipient == _recipient &&
                c.tokenId == _tokenId &&
                c.purpose == _purpose
            ) {
                // Verificar expiracin
                if (
                    c.expirationTime == 0 || block.timestamp < c.expirationTime
                ) {
                    return true;
                }
            }
        }
        return false;
    }

    /**
     * @dev Obtener todos los consentimientos de un paciente
     */
    function getPatientConsents(
        address _patient
    ) public view returns (bytes32[] memory) {
        return userConsents[_patient];
    }

    /**
     * @dev Obtener detalles de un consentimiento
     */
    function getConsentDetails(
        bytes32 _consentId
    ) public view returns (Consent memory) {
        return consents[_consentId];
    }
}

