// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/**
 * @title OrthoConsult
 * @dev Un mercado descentralizado para segundas opiniones de ortodoncia.
 * Los pacientes o dentistas pueden solicitar consultas sobre casos complejos,
 * y los ortodoncistas pueden ofrecer su experiencia a cambio de una recompensa.
 */
contract OrthoConsult {
    // --- Estructuras de Datos ---

    /**
     * @dev Representa un caso clnico subido por un paciente o dentista.
     */
    struct Case {
        address payable patient;
        uint256 caseId;
        string descriptionHash;
        uint256 reward;
        uint256 requiredOpinions;
        bool isOpen;
        uint opinionsReceived;
    }

    /**
     * @dev Representa la opinin de un ortodoncista sobre un caso.
     */
    struct Opinion {
        address orthodontist;
        string opinionHash;
        bool isQualityMarked;
    }

    // --- Variables de Estado ---

    uint256 private _caseCounter;
    mapping(uint256 => Case) public cases;
    mapping(uint256 => Opinion[]) public caseOpinions;
    mapping(address => bool) public isRegisteredOrthodontist;
    mapping(uint256 => mapping(address => bool)) public hasClaimedReward;

    // --- Eventos ---

    event CaseCreated(
        uint256 indexed caseId,
        address indexed patient,
        uint256 reward,
        uint256 requiredOpinions
    );
    event OpinionSubmitted(
        uint256 indexed caseId,
        address indexed orthodontist
    );
    event RewardClaimed(
        uint256 indexed caseId,
        address indexed orthodontist,
        uint256 amount
    );
    event OrthodontistRegistered(address indexed orthodontist);

    // --- Modificadores ---

    modifier onlyRegisteredOrthodontist() {
        require(
            isRegisteredOrthodontist[msg.sender],
            "OrthoConsult: Caller is not a registered orthodontist"
        );
        _;
    }

    // --- Funciones Pblicas ---

    /**
     * @dev Registra a un nuevo ortodoncista en el sistema.
     * En produccin, esto debera tener control de acceso (onlyOwner).
     */
    function registerOrthodontist(address _orthoAddress) public {
        require(_orthoAddress != address(0), "Invalid address");
        require(!isRegisteredOrthodontist[_orthoAddress], "Already registered");

        isRegisteredOrthodontist[_orthoAddress] = true;
        emit OrthodontistRegistered(_orthoAddress);
    }

    /**
     * @dev Crea un nuevo caso de consulta.
     * El paciente enva ETH como recompensa junto con la transaccin.
     */
    function createCase(
        string memory _descriptionHash,
        uint256 _reward,
        uint256 _requiredOpinions
    ) public payable {
        require(
            bytes(_descriptionHash).length > 0,
            "Description hash required"
        );
        require(_requiredOpinions > 0, "At least 1 opinion required");
        require(msg.value >= _reward, "Insufficient ETH sent");
        require(_reward > 0, "Reward must be greater than 0");

        uint256 newCaseId = _caseCounter;
        _caseCounter++;

        cases[newCaseId] = Case({
            patient: payable(msg.sender),
            caseId: newCaseId,
            descriptionHash: _descriptionHash,
            reward: _reward,
            requiredOpinions: _requiredOpinions,
            isOpen: true,
            opinionsReceived: 0
        });

        emit CaseCreated(newCaseId, msg.sender, _reward, _requiredOpinions);
    }

    /**
     * @dev Permite a un ortodoncista registrado enviar su opinin sobre un caso.
     */
    function submitOpinion(
        uint256 _caseId,
        string memory _opinionHash
    ) public onlyRegisteredOrthodontist {
        require(_caseId < _caseCounter, "Case does not exist");
        require(cases[_caseId].isOpen, "Case is closed");
        require(bytes(_opinionHash).length > 0, "Opinion hash required");

        // Verificar que el ortodoncista no haya opinado ya
        Opinion[] storage opinions = caseOpinions[_caseId];
        for (uint i = 0; i < opinions.length; i++) {
            require(
                opinions[i].orthodontist != msg.sender,
                "Already submitted opinion for this case"
            );
        }

        // Agregar la opinin
        caseOpinions[_caseId].push(
            Opinion({
                orthodontist: msg.sender,
                opinionHash: _opinionHash,
                isQualityMarked: false
            })
        );

        // Incrementar contador
        cases[_caseId].opinionsReceived++;

        emit OpinionSubmitted(_caseId, msg.sender);

        // Si se alcanz el nmero requerido, cerrar el caso
        if (
            cases[_caseId].opinionsReceived >= cases[_caseId].requiredOpinions
        ) {
            cases[_caseId].isOpen = false;
        }
    }

    /**
     * @dev Permite a un ortodoncista reclamar su parte de la recompensa.
     * La recompensa se divide equitativamente entre todos los que dieron opinin.
     */
    function claimReward(uint256 _caseId) public onlyRegisteredOrthodontist {
        require(_caseId < _caseCounter, "Case does not exist");
        require(!cases[_caseId].isOpen, "Case still open");
        require(
            !hasClaimedReward[_caseId][msg.sender],
            "Reward already claimed"
        );

        // Verificar que el ortodoncista dio opinin
        bool hasOpinion = false;
        Opinion[] storage opinions = caseOpinions[_caseId];
        for (uint i = 0; i < opinions.length; i++) {
            if (opinions[i].orthodontist == msg.sender) {
                hasOpinion = true;
                break;
            }
        }
        require(hasOpinion, "No opinion submitted for this case");

        // Calcular la porcin de recompensa
        uint256 totalOpinions = cases[_caseId].opinionsReceived;
        uint256 rewardShare = cases[_caseId].reward / totalOpinions;

        // Marcar como reclamado
        hasClaimedReward[_caseId][msg.sender] = true;

        // Transferir ETH
        payable(msg.sender).transfer(rewardShare);

        emit RewardClaimed(_caseId, msg.sender, rewardShare);
    }

    /**
     * @dev Obtiene las opiniones de un caso especfico.
     */
    function getOpinionsByCase(
        uint256 _caseId
    ) public view returns (Opinion[] memory) {
        return caseOpinions[_caseId];
    }

    /**
     * @dev Obtiene informacin de un caso.
     */
    function getCase(uint256 _caseId) public view returns (Case memory) {
        require(_caseId < _caseCounter, "Case does not exist");
        return cases[_caseId];
    }

    /**
     * @dev Obtiene el nmero total de casos creados.
     */
    function getTotalCases() public view returns (uint256) {
        return _caseCounter;
    }
}

