// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

/**
 * @title OrthoData - Contrato para gestin de datos ortodnticos como NFTs
 * @dev Permite a los pacientes crear NFTs de sus diagnsticos y controlar el acceso
 */
contract OrthoData is ERC721, ERC721URIStorage, Ownable {
    using Counters for Counters.Counter;
    using Strings for uint256;

    Counters.Counter private _tokenIdCounter;

    // Estructura para almacenar datos mdicos
    struct MedicalData {
        string diagnosis; // Diagnstico (Clase I, II, III, etc.)
        uint256 severity; // Severidad (0-1000, donde 1000 es mximo)
        uint256 timestamp; // Fecha del diagnstico
        string ipfsHash; // Hash IPFS con datos completos
        string recommendations; // Recomendaciones de tratamiento
        bool isPublic; // Si los datos son pblicos
    }

    // Mappings
    mapping(uint256 => MedicalData) public tokenData;
    mapping(uint256 => mapping(address => bool)) public accessPermissions;
    mapping(address => uint256[]) public patientTokens;

    // Eventos
    event DiagnosisMinted(
        uint256 indexed tokenId,
        address indexed patient,
        string diagnosis,
        uint256 severity,
        string ipfsHash
    );

    event AccessGranted(
        uint256 indexed tokenId,
        address indexed patient,
        address indexed grantedTo
    );

    event AccessRevoked(
        uint256 indexed tokenId,
        address indexed patient,
        address indexed revokedFrom
    );

    // Constructor
    constructor() ERC721("OrthoData", "ORTHO") {}

    /**
     * @dev Crear un NFT con diagnstico ortodntico
     */
    function mintDiagnosis(
        address patient,
        string memory diagnosis,
        uint256 severity,
        string memory ipfsHash,
        string memory recommendations
    ) public onlyOwner returns (uint256) {
        require(severity <= 1000, "Severity must be <= 1000");
        require(bytes(ipfsHash).length > 0, "IPFS hash required");

        _tokenIdCounter.increment();
        uint256 tokenId = _tokenIdCounter.current();

        _mint(patient, tokenId);

        // Guardar datos mdicos
        tokenData[tokenId] = MedicalData({
            diagnosis: diagnosis,
            severity: severity,
            timestamp: block.timestamp,
            ipfsHash: ipfsHash,
            recommendations: recommendations,
            isPublic: false
        });

        // Registrar token del paciente
        patientTokens[patient].push(tokenId);

        // El paciente siempre tiene acceso a sus datos
        accessPermissions[tokenId][patient] = true;

        // Emitir evento
        emit DiagnosisMinted(tokenId, patient, diagnosis, severity, ipfsHash);

        return tokenId;
    }

    /**
     * @dev Otorgar acceso a un profesional de la salud
     */
    function grantAccess(uint256 tokenId, address professional) public {
        require(ownerOf(tokenId) == msg.sender, "Not token owner");
        require(professional != msg.sender, "Cannot grant access to self");

        accessPermissions[tokenId][professional] = true;

        emit AccessGranted(tokenId, msg.sender, professional);
    }

    /**
     * @dev Revocar acceso a un profesional
     */
    function revokeAccess(uint256 tokenId, address professional) public {
        require(ownerOf(tokenId) == msg.sender, "Not token owner");

        accessPermissions[tokenId][professional] = false;

        emit AccessRevoked(tokenId, msg.sender, professional);
    }

    /**
     * @dev Hacer datos pblicos
     */
    function makePublic(uint256 tokenId) public {
        require(ownerOf(tokenId) == msg.sender, "Not token owner");
        tokenData[tokenId].isPublic = true;
    }

    /**
     * @dev Hacer datos privados
     */
    function makePrivate(uint256 tokenId) public {
        require(ownerOf(tokenId) == msg.sender, "Not token owner");
        tokenData[tokenId].isPublic = false;
    }

    /**
     * @dev Verificar si una direccin tiene acceso a los datos
     */
    function hasAccess(
        uint256 tokenId,
        address viewer
    ) public view returns (bool) {
        address tokenOwner = ownerOf(tokenId);

        return
            viewer == tokenOwner ||
            accessPermissions[tokenId][viewer] ||
            tokenData[tokenId].isPublic;
    }

    /**
     * @dev Obtener datos mdicos (solo si tiene acceso)
     */
    function getMedicalData(
        uint256 tokenId
    ) public view returns (MedicalData memory) {
        require(hasAccess(tokenId, msg.sender), "No access to this data");
        return tokenData[tokenId];
    }

    /**
     * @dev Obtener todos los tokens de un paciente
     */
    function getPatientTokens(
        address patient
    ) public view returns (uint256[] memory) {
        return patientTokens[patient];
    }

    /**
     * @dev Obtener estadsticas del contrato
     */
    function getStats()
        public
        view
        returns (uint256 totalDiagnoses, uint256 activePatients)
    {
        totalDiagnoses = _tokenIdCounter.current();

        // Contar pacientes nicos (simplificado)
        activePatients = 0;
        for (uint256 i = 1; i <= totalDiagnoses; i++) {
            if (_exists(i)) {
                activePatients++;
                break; // Simplificacin para demo
            }
        }
    }

    // Overrides requeridos por ERC721URIStorage
    function _burn(
        uint256 tokenId
    ) internal override(ERC721, ERC721URIStorage) {
        super._burn(tokenId);
    }

    function tokenURI(
        uint256 tokenId
    ) public view override(ERC721, ERC721URIStorage) returns (string memory) {
        require(_exists(tokenId), "Token does not exist");

        // Crear metadata dinmica para el NFT
        MedicalData memory data = tokenData[tokenId];

        string memory json = string(
            abi.encodePacked(
                '{"name": "Ortho Diagnosis #',
                Strings.toString(tokenId),
                '",',
                '"description": "Orthodontic diagnosis NFT",',
                '"attributes": [',
                '{"trait_type": "Diagnosis", "value": "',
                data.diagnosis,
                '"},',
                '{"trait_type": "Severity", "value": ',
                Strings.toString(data.severity),
                "},",
                '{"trait_type": "Timestamp", "value": ',
                Strings.toString(data.timestamp),
                "}",
                "],",
                '"image": "ipfs://',
                data.ipfsHash,
                '/diagnosis.png"',
                "}"
            )
        );

        return
            string(
                abi.encodePacked(
                    "data:application/json;base64,",
                    base64Encode(bytes(json))
                )
            );
    }

    function supportsInterface(
        bytes4 interfaceId
    ) public view override(ERC721, ERC721URIStorage) returns (bool) {
        return super.supportsInterface(interfaceId);
    }

    // Funcin auxiliar para base64 encoding
    function base64Encode(
        bytes memory data
    ) internal pure returns (string memory) {
        string
            memory TABLE = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/";

        uint256 encodedLen = 4 * ((data.length + 2) / 3);
        string memory result = new string(encodedLen + 32);

        assembly {
            mstore(result, encodedLen)
            let tablePtr := add(TABLE, 1)
            let dataPtr := data
            let endPtr := add(dataPtr, mload(data))
            let resultPtr := add(result, 32)

            for {} lt(dataPtr, endPtr) {} {
                dataPtr := add(dataPtr, 3)
                let input := mload(dataPtr)

                mstore8(
                    resultPtr,
                    mload(add(tablePtr, and(shr(18, input), 0x3F)))
                )
                resultPtr := add(resultPtr, 1)
                mstore8(
                    resultPtr,
                    mload(add(tablePtr, and(shr(12, input), 0x3F)))
                )
                resultPtr := add(resultPtr, 1)
                mstore8(
                    resultPtr,
                    mload(add(tablePtr, and(shr(6, input), 0x3F)))
                )
                resultPtr := add(resultPtr, 1)
                mstore8(resultPtr, mload(add(tablePtr, and(input, 0x3F))))
                resultPtr := add(resultPtr, 1)
            }

            switch mod(mload(data), 3)
            case 1 {
                mstore8(sub(resultPtr, 1), 0x3d)
                mstore8(sub(resultPtr, 2), 0x3d)
            }
            case 2 {
                mstore8(sub(resultPtr, 1), 0x3d)
            }
        }

        return result;
    }
}

