// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./OrthoData.sol";

/**
 * @title OrthoMarket - Mercado para compartir datos ortodnticos annimos
 * @dev Permite a los pacientes vender el uso de sus datos annimos para investigacin
 */
contract OrthoMarket is ReentrancyGuard, Ownable {
    OrthoData public orthoData;

    struct DataListing {
        uint256 tokenId;
        address seller;
        uint256 price;
        bool isActive;
        uint256 timestamp;
    }

    mapping(uint256 => DataListing) public listings;
    uint256[] public activeListings;

    event DataListed(
        uint256 indexed tokenId,
        address indexed seller,
        uint256 price
    );

    event DataPurchased(
        uint256 indexed tokenId,
        address indexed seller,
        address indexed buyer,
        uint256 price
    );

    event ListingCancelled(uint256 indexed tokenId);

    constructor(address _orthoDataAddress) {
        orthoData = OrthoData(_orthoDataAddress);
    }

    /**
     * @dev Listar datos para venta (solo datos annimos/publicos)
     */
    function listData(uint256 tokenId, uint256 price) public {
        require(orthoData.ownerOf(tokenId) == msg.sender, "Not token owner");
        require(price > 0, "Price must be > 0");
        require(!listings[tokenId].isActive, "Already listed");

        listings[tokenId] = DataListing({
            tokenId: tokenId,
            seller: msg.sender,
            price: price,
            isActive: true,
            timestamp: block.timestamp
        });

        activeListings.push(tokenId);

        emit DataListed(tokenId, msg.sender, price);
    }

    /**
     * @dev Comprar datos annimos para investigacin
     */
    function purchaseData(uint256 tokenId) public payable nonReentrant {
        DataListing memory listing = listings[tokenId];
        require(listing.isActive, "Not active listing");
        require(msg.value >= listing.price, "Insufficient payment");

        // Transferir payment al vendedor
        payable(listing.seller).transfer(listing.price);

        // Otorgar acceso temporal al comprador (30 das)
        orthoData.grantAccess(tokenId, msg.sender);

        // Remover listing
        listings[tokenId].isActive = false;
        _removeListing(tokenId);

        emit DataPurchased(tokenId, listing.seller, msg.sender, listing.price);
    }

    /**
     * @dev Cancelar listing
     */
    function cancelListing(uint256 tokenId) public {
        require(listings[tokenId].seller == msg.sender, "Not seller");
        require(listings[tokenId].isActive, "Not active");

        listings[tokenId].isActive = false;
        _removeListing(tokenId);

        emit ListingCancelled(tokenId);
    }

    /**
     * @dev Obtener listings activos
     */
    function getActiveListings() public view returns (uint256[] memory) {
        return activeListings;
    }

    /**
     * @dev Remover listing del array activo
     */
    function _removeListing(uint256 tokenId) internal {
        for (uint256 i = 0; i < activeListings.length; i++) {
            if (activeListings[i] == tokenId) {
                activeListings[i] = activeListings[activeListings.length - 1];
                activeListings.pop();
                break;
            }
        }
    }

    // Funcin para retirar fondos del contrato (solo owner)
    function withdraw() public onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "No funds to withdraw");
        payable(owner()).transfer(balance);
    }
}

