// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title PatientEvolution - Contrato para rastrear evolucin de pacientes en blockchain
 * @dev Almacena hashes de snapshots de evolucin temporal en blockchain inmutable
 */
contract PatientEvolution is Ownable {
    // Estructura para almacenar un punto de evolucin
    struct EvolutionSnapshot {
        string patientDid; // DID del paciente
        string contentHash; // Hash IPFS del anlisis completo
        uint256 severity; // Severidad en el momento (0-10)
        uint256 timestamp; // Timestamp del anlisis
        string diagnosis; // Diagnstico en ese momento
        bool isAnomaly; // Flag si detect anomala
    }

    // Mappings
    mapping(string => EvolutionSnapshot[]) public patientEvolutions; // DID => array de snapshots
    mapping(string => uint256) public patientSnapshotCount; // DID => cantidad de snapshots

    // Eventos
    event EvolutionRecorded(
        string indexed patientDid,
        string contentHash,
        uint256 severity,
        uint256 timestamp,
        string diagnosis,
        bool isAnomaly
    );

    event AnomalyDetected(
        string indexed patientDid,
        uint256 severity,
        uint256 timestamp,
        string reason
    );

    /**
     * @dev Registrar un snapshot de evolucin en blockchain
     * @param patientDid DID del paciente
     * @param contentHash Hash IPFS con los datos completos del anlisis
     * @param severity Severidad del diagnstico (0-10)
     * @param diagnosis Diagnstico actual
     * @param isAnomaly Si se detect una anomala en la evolucin
     */
    function recordEvolution(
        string memory patientDid,
        string memory contentHash,
        uint256 severity,
        string memory diagnosis,
        bool isAnomaly
    ) public onlyOwner returns (uint256) {
        require(bytes(patientDid).length > 0, "Patient DID required");
        require(bytes(contentHash).length > 0, "Content hash required");
        require(severity <= 10, "Severity must be 0-10");

        // Crear snapshot
        EvolutionSnapshot memory snapshot = EvolutionSnapshot({
            patientDid: patientDid,
            contentHash: contentHash,
            severity: severity,
            timestamp: block.timestamp,
            diagnosis: diagnosis,
            isAnomaly: isAnomaly
        });

        // Guardar en blockchain
        patientEvolutions[patientDid].push(snapshot);
        patientSnapshotCount[patientDid]++;

        // Emitir eventos
        emit EvolutionRecorded(
            patientDid,
            contentHash,
            severity,
            block.timestamp,
            diagnosis,
            isAnomaly
        );

        if (isAnomaly) {
            emit AnomalyDetected(
                patientDid,
                severity,
                block.timestamp,
                "Unusual evolution pattern detected"
            );
        }

        return patientSnapshotCount[patientDid];
    }

    /**
     * @dev Obtener todos los snapshots de un paciente
     * @param patientDid DID del paciente
     * @return Array de snapshots
     */
    function getPatientEvolution(
        string memory patientDid
    ) public view returns (EvolutionSnapshot[] memory) {
        return patientEvolutions[patientDid];
    }

    /**
     * @dev Obtener el ltimo snapshot de un paciente
     * @param patientDid DID del paciente
     */
    function getLatestSnapshot(
        string memory patientDid
    ) public view returns (EvolutionSnapshot memory) {
        require(
            patientSnapshotCount[patientDid] > 0,
            "No snapshots for this patient"
        );
        uint256 lastIndex = patientSnapshotCount[patientDid] - 1;
        return patientEvolutions[patientDid][lastIndex];
    }

    /**
     * @dev Obtener el nmero de snapshots de un paciente
     * @param patientDid DID del paciente
     */
    function getSnapshotCount(
        string memory patientDid
    ) public view returns (uint256) {
        return patientSnapshotCount[patientDid];
    }

    /**
     * @dev Verificar si un paciente tiene anomalas registradas
     * @param patientDid DID del paciente
     */
    function hasAnomalies(string memory patientDid) public view returns (bool) {
        EvolutionSnapshot[] memory snapshots = patientEvolutions[patientDid];
        for (uint256 i = 0; i < snapshots.length; i++) {
            if (snapshots[i].isAnomaly) {
                return true;
            }
        }
        return false;
    }

    /**
     * @dev Obtener la tendencia de severidad (simplificada)
     * @param patientDid DID del paciente
     * @return improving True si est mejorando, False si empeorando/estable
     */
    function getTrend(
        string memory patientDid
    ) public view returns (bool improving) {
        require(
            patientSnapshotCount[patientDid] >= 2,
            "Need at least 2 snapshots"
        );

        EvolutionSnapshot[] memory snapshots = patientEvolutions[patientDid];
        uint256 count = snapshots.length;

        uint256 firstSeverity = snapshots[0].severity;
        uint256 lastSeverity = snapshots[count - 1].severity;

        improving = lastSeverity < firstSeverity;
    }

    /**
     * @dev Obtener estadsticas globales
     */
    function getGlobalStats()
        public
        view
        returns (uint256 totalSnapshots, uint256 totalAnomalies)
    {
        // Nota: Esta es una funcin costosa. En produccin se debera
        // mantener contadores incrementales
        totalSnapshots = 0;
        totalAnomalies = 0;

        // Este enfoque es solo para demo. En produccin, usar mappings contadores.
        // Por ahora retornamos 0 para evitar iteraciones costosas
        return (0, 0);
    }
}

